import React, { useEffect } from 'react';
import './App.css';
import TablePlanets from './Components/TablePlanets';
import { useStarWarsContext } from './Context/StarWarsContext';

function App() {
  const { test, fetchPlanetsStarWars } = useStarWarsContext();

  useEffect(() => {
    fetchPlanetsStarWars();
  }, []);

  return (
    <div>
      <span>{test}</span>
      <TablePlanets />
    </div>
  );
}

export default App;
